package com.jsp.studyShare.model;import java.util.Date;public class ResponseData {    private int did;    private int cid;    private String dataName;    private String dataDesc;    private String dataFile;    private Date uploadTime;    private String nickname;    public int getDid() {        return did;    }    public void setDid(int did) {        this.did = did;    }    public int getCid() {        return cid;    }    public void setCid(int cid) {        this.cid = cid;    }    public String getDataName() {        return dataName;    }    public void setDataName(String dataName) {        this.dataName = dataName;    }    public String getDataDesc() {        return dataDesc;    }    public void setDataDesc(String dataDesc) {        this.dataDesc = dataDesc;    }    public String getDataFile() {        return dataFile;    }    public void setDataFile(String dataFile) {        this.dataFile = dataFile;    }    public Date getUploadTime() {        return uploadTime;    }    public void setUploadTime(Date uploadTime) {        this.uploadTime = uploadTime;    }    public String getNickname() {        return nickname;    }    public void setNickname(String nickname) {        this.nickname = nickname;    }}